import React from "react";
import "./style.css";
import { Link } from "react-router-dom";


function Nav() {
  return (
    <nav className="navbar ">
      <li className="nav-item">
        <Link to="/" >

          Home
        </Link>
      </li>
      <li className="nav-item">
        <Link to="/newstore" >



          Add New Store
        </Link>

          <Link to="/login" >


      Login
        </Link>
      </li>
    </nav>
  );
}

export default Nav;
